Este soneto es obra del poeta español Carlos Murciano (nacido en 1931 en Arcos de la Frontera, Cádiz). Es un poeta, crítico literario y músico que continúa vivo y que ha desarrollado su obra principalmente durante la segunda mitad del siglo XX y principios del XXI.
